    const post = props.posts.find(post => post.id == id)

    console.log(post);

    return (

        <Card style={{ margin: '1rem' }}>
            <Card.Body>
                <Card.Title>{post.Title}</Card.Title>
                <Card.Text>React </Card.Text>
            </Card.Body>
        </Card>)
}

export default Post;
